import React, { Component } from 'react';
import './App.css';
import Home from './Components/Home';
import _LayoutSIP from './Components/Layout/_LayoutSIP';

class App extends Component {
    render() {
        return (
            <div className="App">
                <Home />
                <_LayoutSIP />

            </div>

        );
    }
}

export default App;
